  offshore of Massachusetts within northern Cape Cod Bay (CCB_FILL_HS Esri BINARY
  GRID, UTM Zone 19N).\",\n\t\"tracking_summary\": {\n\t\t\"total\": 11,\n\t\t\"recent\":
